(242,"Stalwart/Nerfs d’Acier","NULL/NULL","NULL/NULL","Ignores the effects of opposing Pokémon's Abilities and moves that draw in moves./Permet d’ignorer l’effet des capacités ou des talents qui\nattirent les capacités."),
(243,"Steam Engine/Turbine","NULL/NULL","NULL/NULL","Boosts the Speed stat drastically when the Pokémon is hit by a Fire- or Water-type move./Lorsque le Pokémon est touché par des capacités\nde type Eau ou Feu, sa Vitesse augmente énormément."),
(244,"Punk Rock/Punk Rock","NULL/NULL","NULL/NULL","Boosts the power of sound-based moves. The Pokémon also takes half the damage from these kinds of moves./Augmente la puissance des capacités basées sur le son.\nLe Pokémon ne subit que la moitié des dégâts quand\nil est touché par ce genre de capacités."),
(245,"Sand Spit/Expul’Sable","NULL/NULL","NULL/NULL","The Pokémon creates a sandstorm when it's hit by an attack./Le Pokémon déclenche une tempête de sable
