(246,"Ice Scales/Écailles Glacées","NULL/NULL","NULL/NULL","The Pokémon is protected by ice scales, which halve the damage taken from special moves./Le Pokémon est protégé par des écailles de glace.\nLes dégâts qu’il subit par des capacités spéciales\nsont divisés par deux."),
(247,"Ripen/Mûrissement","NULL/NULL","NULL/NULL","Ripens Berries and doubles their effect./Le Pokémon fait mûrir la Baie qu’il tient\net double ainsi son effet."),
(248,"Ice Face/Tête de Gel","NULL/NULL","NULL/NULL","The Pokémon's ice head can take a physical attack as a substitute, but the attack also changes the Pokémon's appearance. The ice will be restored when it snows./Le glaçon sur sa tête encaisse les attaques physiques\nà la place du Pokémon, mais sa destruction modifie\nson apparence. Le glaçon se reforme quand il neige."),
(249,"Power Spot/Cercle d’Énergie","NULL/NULL","NULL/NULL","Just being next to the Pokémon powers up moves./Augmente la puissance des capacités des Pokémon\nqui se trouvent à proximité."),
(250,"Mimicry/Mimétisme","NULL/NULL","NULL/NULL","Changes the Pokémon’s type depending on the terrain./Le Pokémon adopte le même type que le terrain\nlorsqu’un champ est actif."),
(251,"Screen Cleaner/Brise-Barrière","NULL/NULL","NULL/NULL","When the Pokémon enters a battle, the effects of
