(252,"Steely Spirit/Boost Acier","NULL/NULL","NULL/NULL","Powers up the Steel-type moves of the Pokémon and its allies./Augmente la puissance des attaques de type Acier\ndu Pokémon et de ses alliés."),
(253,"Perish Body/Corps Condamné","NULL/NULL","NULL/NULL","When hit by a move that makes direct contact,
