(256,"Neutralizing Gas/Gaz Inhibiteur","NULL/NULL","NULL/NULL","While the Pokémon is in the battle, the effects of all other Pokémon's Abilities will be nullified or will not be triggered./Si un Pokémon avec Gaz Inhibiteur est sur le terrain,\nles effets des talents de tous les autres Pokémon ne\ns’activent pas ou sont neutralisés."),
(257,"Pastel Veil/Voile Pastel","NULL/NULL","NULL/NULL","Protects the Pokémon and its ally Pokémon from
