(258,"Hunger Switch/Déclic Fringale","NULL/NULL","NULL/NULL","The Pokémon changes its form, alternating between its Full Belly Mode and Hangry Mode after the end of every turn./À la fin de chaque tour, le Pokémon alterne\nentre ses formes Mode Rassasié et Mode Affamé."),
(259,"Quick Draw/Tir Vif","NULL/NULL","NULL/NULL","Enables the Pokémon to move first occasionally./Permet parfois au Pokémon d’agir en premier."),
(260,"Unseen Fist/Poing Invisible","NULL/NULL","NULL/NULL","If the Pokémon uses moves that make direct contact, it can attack the target even if the target protects itself./Si le Pokémon utilise une attaque directe, celle-ci\npourra toucher la cible même si elle se protège."),
(261,"Curious Medicine/Breuvage Suspect","NULL/NULL","NULL/NULL","When the Pokémon enters a battle, it scatters medicine from its shell, which removes all stat changes from allies./Quand il entre au combat, le Pokémon répand\nune substance qui annule les changements de stats\nde ses alliés."),
(262,"Transistor/Transistor","NULL/NULL","NULL/NULL","Powers up Electric-type moves./Augmente la puissance des capacités de type Électrik."),
