(264,"Chilling Neigh/Blanche Ruade","NULL/NULL","NULL/NULL","When the Pokémon knocks out a target, it utters a chilling neigh, which boosts its Attack stat./Quand le Pokémon met un ennemi K.O., il émet\nun hennissement glaçant, ce qui augmente son Attaque."),
