(268,"Lingering Aroma/Odeur Tenace","NULL/NULL","NULL/NULL","Contact with the Pokémon changes the attacker's Ability to Lingering Aroma./Lorsque le Pokémon subit une attaque directe, le talent\nde l’attaquant est remplacé par Odeur Tenace."),
(269,"Seed Sower/Semencier","NULL/NULL","NULL/NULL","Turns the ground into Grassy Terrain when the Pokémon is hit by an attack./Le Pokémon crée un champ herbu quand\nil subit une attaque."),
(270,"Thermal Exchange/Thermodynamique","NULL/NULL","NULL/NULL","Boosts the Attack stat when the Pokémon is hit by a Fire-type move. The Pokémon also cannot be burned./Lorsque le Pokémon est touché par une capacité de type\nFeu, son Attaque augmente. Il ne peut pas être brûlé."),
(271,"Anger Shell/Courroupace","NULL/NULL","NULL/NULL","When an attack causes its HP to drop to half or less, the Pokémon gets angry. This lowers its Defense and Sp. Def stats but boosts its Attack, Sp. Atk, and Speed stats./Le Pokémon enrage s’il a moins de la moitié de ses PV\naprès avoir subi une attaque. Sa Déf. et sa Déf. Spé.\nbaissent, et son Atq., son Atq. Spé. et sa Vit. augmentent."),
(272,"Purifying Salt/Sel Purificateur","NULL/NULL","NULL/NULL","The Pokémon's pure salt protects it from status conditions and halves the damage taken from Ghost-type moves./Le sel pur immunise le Pokémon contre les altérations\nde statut, et diminue de moitié les dégâts des capacités\nde type Spectre."),
(273,"Well-Baked Body/Bien Cuit","NULL/NULL","NULL/NULL","The Pokémon takes no damage when hit by Fire-type moves. Instead, its Defense stat is sharply boosted./Si le Pokémon est touché par une capacité de type Feu,\nil ne subit aucun dégât et sa Défense augmente\nbeaucoup."),
(274,"Wind Rider/Aéroporté","NULL/NULL","NULL/NULL","Boosts the Pokémon's Attack stat if Tailwind takes effect or if the Pokémon is hit by a wind move. The Pokémon also takes no damage from wind moves./L’Attaque du Pokémon augmente si un vent arrière souffle\nou s’il est touché par une capacité faisant appel au vent.\nDans ce dernier cas, il ne subit aucun dégât."),
