le volume sonore de divers éléments.",NULL,NULL,NULL,NULL),
(1314,"Fruit Bunch/Fruits","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. The syrupy fruits give off a strong
tropical feel./Un ingrédient de cuisine pour le camping.
Les fruits écrasés donnent un parfum tropical
à toute préparation.",NULL,10,NULL,NULL),
(1315,"Moomoo Cheese/Fromage Meumeu","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. Melted cheese can really give a
curry some richness./Un ingrédient de cuisine pour le camping.
Une fois fondu, il apporte une dose d’onctuosité
au curry.",NULL,20,NULL,NULL),
(1316,"Spice Mix/Épices","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. There are over fifty spices
contained within this ingredient’s hot flavor./Un ingrédient de cuisine pour le camping.
Ce mélange de plus d’une cinquantaine d’épices
est souvent utilisé pour donner du piquant au curry.",NULL,50,NULL,NULL),
(1317,"Fresh Cream/Crème Fraîche","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. Add some whipped cream to a
spicy curry to give it some sweetness./Un ingrédient de cuisine pour le camping.
En fouettant cette crème, elle peut être ajoutée
à un curry pour y apporter de la douceur.",NULL,10,NULL,NULL),
(1318,"Packaged Curry/Curry Instantané","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. Using packaged curry helps
make sure there are no slipups when cooking./Un ingrédient de cuisine pour le camping.
À ajouter au curry pour corriger les erreurs
de préparation.",NULL,10,NULL,NULL),
(1319,"Coconut Milk/Lait de Coco","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. The refined sweetness of this
coconut milk makes it quite popular./Un ingrédient de cuisine pour le camping.
La douceur incomparable de cette boisson
à la noix de coco lui vaut un grand succès.",NULL,10,NULL,NULL),
(1320,"Instant Noodles/Nouilles","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. It has a junk-food sort of taste,
but it goes well with curry./Un ingrédient de cuisine pour le camping.
La saveur de cet ingrédient, somme toute banal,
se marie étonnamment bien avec le curry.",NULL,10,NULL,NULL),
(1321,"Precooked Burger/Steak Haché","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. If you’re unsure about what to
cook, you can’t go wrong with some burger./Un ingrédient de cuisine pour le camping.
Quand on ne sait pas quoi ajouter à un curry,
le steak haché est une valeur sûre.",NULL,10,NULL,NULL),
(1322,"Gigantamix/Poudre Gigamax","NULL/NULL","NULL/NULL",NULL,"curry-ingredients","misc","One of the many ingredients that can be used for
cooking at your camp. A mysterious spice. Even a tiny
sprinkle is sure to make a curry gigantic./Un ingrédient de cuisine pour le camping.
Une simple pincée de cette épice mystérieuse
permet de donner une taille démesurée au curry.",NULL,50,NULL,NULL),
(1323,"Wishing Chip/Fragment Vœu","NULL/NULL","NULL/NULL",NULL,"unused","key","Toss a number of them into a Pokémon Den for the
chance to attract a wild Dynamax Pokémon./En lancer plusieurs dans l’antre d’un Pokémon augmente
les chances d’y faire apparaître un Pokémon Dynamax.",NULL,NULL,NULL,NULL),
(1324,"Rotom Bike/Moticyclette","NULL/NULL","NULL/NULL",NULL,"unused","key","This bike can be combined with the Pokémon Rotom to
not only do a turbo boost but also run on the water./Sous l’influence de Motisma, cette bicyclette permet
non seulement de mettre le turbo, mais également
de se déplacer sur l’eau.",NULL,NULL,NULL,NULL),
(1325,"Catching Charm/Charme Stabilité","NULL/NULL","NULL/NULL",NULL,"gameplay","key","Holding it is said to increase the chance of getting a
critical catch. Curiously, the charm doesn’t shake much./Ce porte-bonheur permet de stabiliser les Poké Balls
et augmente les chances de réaliser une capture
critique.",NULL,NULL,NULL,NULL),
(1326,"Old Letter/Lettre Jaunie","NULL/NULL","NULL/NULL",NULL,"plot-advancement","key","A letter entrusted to you by a girl, to be delivered to
a boy. Strangely, it looks old to you./Une lettre confiée par une petite fille,
dont le destinataire est un petit garçon.
Elle semble jaunie par le temps...",NULL,NULL,NULL,NULL),
(1327,"Band Autograph/Dédicace","NULL/NULL","NULL/NULL",NULL,"unused","key","It’s signed by all members of the Galar region’s most
