(202,"Slush Rush/Chasse-Neige","During Hail, this Pokémon has double Speed./NULL","During Hail, this Pokémon has double Speed./NULL","Boosts the Pokémon's Speed stat in snow./Augmente la Vitesse du Pokémon quand il neige."),
(203,"Long Reach/Longue Portée","A move used by this Pokémon will not make contact./NULL","This Pokémon's moves do not make contact./NULL","The Pokémon uses its moves without making contact with the target./Le Pokémon est capable d’utiliser toutes ses capacités\nsans entrer en contact direct avec sa cible."),
(204,"Liquid Voice/Hydrata-Son","When this Pokémon uses a move that is sound-based, that move's type is Water./NULL","Sound-based moves become Water-type./NULL","Sound-based moves become Water-type moves./Toutes les attaques sonores du Pokémon prennent\nle type Eau."),
(205,"Triage/Prioguérison","This Pokémon's healing moves have their priority increased by 3./NULL","This Pokémon's healing moves have their priority increased by 3./NULL","Gives priority to the Pokémon's healing moves./Rend les capacités de soin prioritaires."),
(206,"Galvanize/Peau Électrique","When this Pokémon uses a Normal moves, that move is Electric its power is 1.2×./NULL","This Pokémon's Normal moves are Electric and have their power increased to 1.2×./NULL","Normal-type moves become Electric-type moves. The power of those moves is boosted a little./Les capacités de type Normal deviennent de type\nÉlectrik. Leur puissance augmente légèrement."),
(207,"Surge Surfer/Surf Caudal","Doubles this Pokémon's Speed on Electric Terrain./NULL","Doubles this Pokémon's Speed on Electric Terrain./NULL","Doubles the Pokémon's Speed stat on Electric Terrain./La Vitesse du Pokémon est doublée sur\nun champ électrifié."),
(208,"Schooling/Banc","If this Pokémon is a wishiwashi and level 20 or above, then when it enters battle and at the start of each turn, it becomes Schooling Form if its HP is 25% or higher and Solo Form otherwise.
INSERT INTO ability (id, name, description, smallDescription, effect) VALUES 
(302,"Toxic Chain/Chaîne Toxique","NULL/NULL","NULL/NULL","The power of the Pokémon's toxic chain may badly poison any target the Pokémon hits with a move/Grâce aux pouvoirs de sa chaîne imprégnée de toxines,\nle Pokémon peut empoisonner gravement sa cible\nen la touchant avec une capacité."),
(303,"Embody Aspect/Force Mémorielle","NULL/NULL","NULL/NULL","The Pokémon's heart fills with memories, causing the Mask to shine and one of the Pokémon's stats to be boosted./Le Pokémon fait briller le Masque en puisant dans ses souvenirs, ce qui augmente ses stats."),
(304,"Tera Shift/Téramorphose","NULL/NULL","NULL/NULL","When the Pokémon enters a battle, it absorbs the energy around itself and transforms into its Terastal Form./Quand le Pokémon rejoint le combat, il absorbe\nl’énergie alentour et prend sa Forme Téracristal."),
(305,"Tera Shell/Téra-Carapace","NULL/NULL","NULL/NULL","The Pokémon's shell contains the powers of each type. All damage-dealing moves that hit the Pokémon when its HP is full will not be very effective./Grâce à sa carapace qui renferme l’énergie de tous\nles types, les capacités subies par ce Pokémon quand\nses PV sont au maximum ne sont pas très efficaces."),
(306,"Teraform Zero/Téraformation 0","NULL/NULL","NULL/NULL","When Terapagos changes into its Stellar Form, it uses its hidden powers to eliminate all effects of weather and terrain, reducing them to zero./Lorsque Terapagos prend sa Forme Stellaire, il utilise\nson pouvoir enfoui pour annuler les effets de la météo\net des champs actifs."),
(307,"Poison Puppeteer/Emprise Toxique","NULL/NULL","NULL/NULL","Pokémon poisoned by Pecharunt's moves will also become confused./Lorsque Pêchaminus empoisonne un Pokémon grâce\nà l’une de ses capacités, ce dernier devient également\nconfus.");
